import React from 'react';

const Routines = async () => {
   await fetch('http://fitnesstrac-kr.herokuapp.com/api/routines', {
    headers: {
        'Content-Type': 'application/json',
    },
    }).then(response => response.json())
    .then(result => {
        console.log(result);
        return result;

    })
    .catch(console.error);
}

export default Routines;
